import React, { useState, useEffect } from 'react';
import axios from 'axios';

const AdminPage = () => {
  const [category, setCategory] = useState('');
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(false);
  const [selectedBird, setSelectedBird] = useState(null);
  const [editModalVisible, setEditModalVisible] = useState(false);

  useEffect(() => {
    if (!category) return;

    setLoading(true);
    axios.get(`http://localhost:5555/api/${category}`)
      .then(response => {
        // Normalize the data structure to ensure consistency
        const normalizedData = response.data.map(item => ({
          id: item._id,
          name: item.name,
          image: item.image,
          origin: item.place_of_found || item.origin // Use "place_of_origin" for birds, "origin" for cats and dogs
        }));
        console.log('here', normalizedData, item_id)
        setData(normalizedData);
        setLoading(false);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
        setLoading(false);
      });
  }, [category]);

  const handleCategoryChange = event => {
    setCategory(event.target.value);
  };

  const handleEdit = item => {
    setSelectedBird(item);
    setEditModalVisible(true);
  };

  const handleUpdate = item => {
    // Call API to update the item
    axios.put(`http://localhost:5555/api/${category}/${item._id}`, item)
      .then(response => {
        console.log('Update successful:', response.data);
        // Optionally, update the state or display a success message
        setEditModalVisible(false); // Close the modal after update
      })
      .catch(error => {
        console.error('Error updating item:', error);
        // Handle error scenario
      });
  };

  const handleDelete = itemId => {
    // Call API to delete the item
    axios.delete(`http://localhost:5555/api/${category}/${itemId}`)
      .then(response => {
        console.log('Delete successful:', response.data);
        // Optionally, update the state or display a success message
      })
      .catch(error => {
        console.error('Error deleting item:', error);
      });
  };

  const renderTable = () => {
    if (loading) {
      return <p>Loading...</p>;
    }

    if (!data.length) {
      return <p>No data available.</p>;
    }

    return (
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Photo</th>
            <th>Origin</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {data.map(item => (
            <tr key={item._id}>
              <td>{item.name}</td>
              <td><img src={item.image} alt={item.name} height="100px" /></td>
              <td>{item.origin}</td>
              <td>
                <button onClick={() => handleEdit(item)}>Edit</button>
                <button onClick={() => handleUpdate(item)}>Update</button>
                <button onClick={() => handleDelete(item.id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    );
  };

  return (
    <div>
      <h1>Admin Page</h1>
      <div>
        <label htmlFor="category">Select Category:</label>
        <select id="category" value={category} onChange={handleCategoryChange}>
          <option value="">Select...</option>
          <option value="birds">Birds</option>
          <option value="cats">Cats</option>
          <option value="dogs">Dogs</option>
        </select>
      </div>
      {renderTable()}
      {editModalVisible && (
        <div className="modal">
          <div className="modal-content">
            <span className="close" onClick={() => setEditModalVisible(false)}>&times;</span>
            <h2>Edit Bird</h2>
            <form>
              <label>Name:</label>
              <input type="text" value={selectedBird.name} onChange={e => setSelectedBird({...selectedBird, name: e.target.value})} />
              <label>Species:</label>
              <input type="text" value={selectedBird.species} onChange={e => setSelectedBird({...selectedBird, species: e.target.value})} />
              <label>Family:</label>
              <input type="text" value={selectedBird.family} onChange={e => setSelectedBird({...selectedBird, family: e.target.value})} />
              <label>Habitat:</label>
              <input type="text" value={selectedBird.habitat} onChange={e => setSelectedBird({...selectedBird, habitat: e.target.value})} />
              <label>Place of Found:</label>
              <input type="text" value={selectedBird.place_of_found} onChange={e => setSelectedBird({...selectedBird, place_of_found: e.target.value})} />
              <label>Diet:</label>
              <input type="text" value={selectedBird.diet} onChange={e => setSelectedBird({...selectedBird, diet: e.target.value})} />
              <label>Description:</label>
              <textarea value={selectedBird.description} onChange={e => setSelectedBird({...selectedBird, description: e.target.value})} />
              <label>Wingspan (cm):</label>
              <input type="number" value={selectedBird.wingspan_cm} onChange={e => setSelectedBird({...selectedBird, wingspan_cm: e.target.value})} />
              <label>Weight (kg):</label>
              <input type="number" value={selectedBird.weight_kg} onChange={e => setSelectedBird({...selectedBird, weight_kg: e.target.value})} />
              <label>Image URL:</label>
              <input type="text" value={selectedBird.image} onChange={e => setSelectedBird({...selectedBird, image: e.target.value})} />
              <button onClick={() => handleUpdate(selectedBird)}>Save Changes</button>
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default AdminPage;
